import React, {Fragment} from 'react';
import {BrowserRouter as Router, Route, Switch}from 'react-router-dom'
import Navbar from './components/layouts/Navbar'
import './App.css';

const App = () => {
    return (
        <Router>
        <Fragment>
            <Navbar/>
            <div className='container'>
                <Switch>
                    <Route exact path='/' cpmponent={Home}/>
                </Switch>
            </div>
        </Fragment>
        </Router>
    );
}

export default App;
